def break_cipher(text):
    import string
    import collections
    # global variables
    frequency = []
    alphabet = []
    deciphered_alphabet = []
    known_frequency = ['E', 'T', 'A', 'O', 'I', 'N', 'S', 'R', 'H', 'L', 'D', 'C', 'U', 'M', 'F', 'P', 'G', 'W', 'Y', 'B', 'V', 'K', 'X', 'J', 'Q', 'Z']
    deciphered_text = []

    """Set up two arrays (one for alphabet and the other for calculating 
    the frequency of each letter)as a 2D array. Index is used to access both"""
    def setup():
        # store lowercase letters in array
        for i in string.ascii_uppercase:
            alphabet.append(i)

        for j in range(0, 26):
            frequency.append(0)
            deciphered_alphabet.append("")

    """Function to find the frequency of each letter"""
    def createList():
        for letter in text:

            # update the 2d array to find the most common letter in cipher text
            index = 0
            for char in alphabet:
                if letter == char:
                    frequency[index] = frequency[index] + 1
                index += 1

    def create_alphabet():
        if len(frequency) != 0:
            index = frequency.index(max(frequency))
            alpha_index = string.ascii_uppercase.index(known_frequency[0])
            del frequency[index]
            del alphabet[index]
            del known_frequency[0]
            deciphered_alphabet[alpha_index] = string.ascii_uppercase[index]
            create_alphabet()
        else:
            print(known_frequency)
            print(deciphered_alphabet)
